import React from "react";
import "../Css/Fertilizers.css";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Fertilizers() {
  const fertList = [
    // ⭐ Nitrogen Fertilizers
    {
      id: 1,
      name: "Urea Fertilizer",
      price: 650,
      img: "https://th.bing.com/th/id/OIP.GwyJwAPjA9D9L4PffTv2NgHaI7?w=170&h=205&c=7&r=0&o=7&dpr=1.3&pid=1.7&rm=3"
    },
    {
      id: 2,
      name: "Ammonium Sulphate",
      price: 720,
      img: "https://tse4.mm.bing.net/th/id/OIP.uaaIslxwYGO7sCPRmewrWAAAAA?pid=ImgDet&w=184&h=265&c=7&dpr=1.3&o=7&rm=3"
    },
    {
      id: 3,
      name: "Calcium Ammonium Nitrate (CAN)",
      price: 800,
      img: "data:image/webp;base64,UklGRpocAABXRUJQ..."
    },

    // ⭐ NPK Fertilizers
    {
      id: 4,
      name: "NPK 20-20-20",
      price: 900,
      img: "data:image/webp;base64,UklGRlwhAABXRUJQ..."
    },
    {
      id: 5,
      name: "NPK 10-26-26",
      price: 1100,
      img: "data:image/webp;base64,UklGRv4eAABXRUJQ..."
    },
    {
      id: 6,
      name: "NPK 12-32-16",
      price: 1050,
      img: "https://tse1.mm.bing.net/th/id/OIP.Um2Y67Mpx-A3FUGOIkFuRAHaJ4"
    },

    // ⭐ Phosphorus Fertilizers
    {
      id: 7,
      name: "Single Super Phosphate (SSP)",
      price: 450,
      img: "https://tse4.mm.bing.net/th/id/OIP.-WUCGu5Qg_YJDhNYoWo-8QHaHa"
    },
    {
      id: 8,
      name: "DAP Fertilizer (18-46-0)",
      price: 1350,
      img: "https://th.bing.com/th/id/OIP.gWcZ7i6VQ-41bDNKAA3W2gHaHK"
    },

    // ⭐ Potassium Fertilizers
    {
      id: 9,
      name: "Potash Fertilizer (MOP)",
      price: 750,
      img: "https://tse4.mm.bing.net/th/id/OIP.bEdvtG3Q5iDlj6k0a773GwAAAA"
    },
    {
      id: 10,
      name: "SOP – Sulphate of Potash",
      price: 880,
      img: "https://5.imimg.com/data5/SJ/TZ/OH/GLADMIN-29199958/selection-170-500x500.png"
    },

    // ⭐ Organic Fertilizers
    {
      id: 11,
      name: "Organic Compost",
      price: 300,
      img: "https://th.bing.com/th/id/OIP.2AtuE4n76_zWhQurq-JTcAHaHa"
    },
    {
      id: 12,
      name: "Vermicompost",
      price: 450,
      img: "https://tse4.mm.bing.net/th/id/OIP.NqhTFw-CrqVy_STWsgzS2gAAAA"
    },
    {
      id: 13,
      name: "Seaweed Extract Fertilizer",
      price: 550,
      img: "https://5.imimg.com/data5/SELLER/Default/2023/1/ZG/SB/QX/132373813/product-jpeg-500x500.jpg"
    },
    {
      id: 14,
      name: "Humic Acid Granules",
      price: 480,
      img: "https://tse1.mm.bing.net/th/id/OIP.eFmwjgaU_DmzpH7f31M0iQHaHa"
    }
  ];

  // ⭐ Add to Cart Function
  const addToCart = (item) => {
    let cart = JSON.parse(localStorage.getItem("cart")) || [];

    const exists = cart.find((c) => c.cropId === `FERT-${item.id}`);

    if (exists) {
      exists.qty += 1;
    } else {
      cart.push({
        cropId: `FERT-${item.id}`,  // unique ID for fertilizers
        cropName: item.name,
        price: item.price,
        qty: 1,
        images: item.img,
        availableStock: 50 // default stock
      });
    }

    localStorage.setItem("cart", JSON.stringify(cart));
    window.dispatchEvent(new Event("cartUpdated"));
    alert("Fertilizer added to cart!");
  };

  return (
    <>
      {/* ⭐ NAVBAR */}
      <Navbar />

      <div className="fert-container" style={{ marginTop: "80px" }}>
        <h2 className="fert-title">
          <i className="fa fa-leaf"></i> Fertilizers & Nutrition
        </h2>

        <div className="fert-grid">
          {fertList.map((item) => (
            <div className="fert-card" key={item.id}>
              <img src={item.img} alt={item.name} className="fert-img" />

              <h3 className="fert-name">{item.name}</h3>

              <p className="fert-price">
                <i className="fa fa-rupee-sign"></i> {item.price}
              </p>

              {/* ⭐ UPDATED ADD TO CART BUTTON */}
              <button
                className="fert-btn"
                onClick={() => addToCart(item)}
              >
                <i className="fa fa-shopping-cart"></i> Buy Fertilizer
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* ⭐ FOOTER */}
      <Footer />
    </>
  );
}

export default Fertilizers;
